private static DetailAST skipAnnotations(Iterator<DetailAST> modifierIterator) {
    DetailAST modifier;
    do {
        modifier = modifierIterator.next();
    }
    while (modifierIterator.hasNext() && modifier.getType() == TokenTypes.ANNOTATION);
    return modifier;
}
